import React from "react";
import Forms from "./Components/Forms/Forms";
import Logo from "./Components/Sidelogo/logo";
const Index = () => {
  return (
    <div style={{display:"flex"}}>
        <div style={{width:"40%"}}>
<Logo/>
        </div>
      <div style={{width:"60%"}}>
        <Forms />
      </div>
    </div>
  );
};

export default Index;
